import React from "react";
import "../partners/Partners.css";

const Partners = () => {
  return (
    <div className="partnersMain">
      <div className="partnersHeader">
        <h3>Partners</h3>
        <p>Partnership is the key of improvement</p>
      </div>
    </div>
  );
};

export default Partners;
